  const [products, setProducts] = useState([])

  useEffect(() => {
    axios.get("shop/sample-product").then((response) => {
      const data = response.data
      setProducts(data)
      console.log(data)
    })
  },[])
  return (
    <div id="home">
      <div className="bg-image">
        <div className="blur-area"></div>
        <h1 className="intro">Welcome To Paradiso</h1>
        <h4 className="intro">We Have the Best Deals for You...</h4>
        <div className="sample-products">
          {/* {
            products.map(product => {
              return <SampleCard key={product.id} image={product}/>;
            })
          } */}
        </div>
      </div>
    </div>
  );
}

export default Home
